import React from "react";
import styles from './Header.module.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; 

const Header = (props) =>{
    return(
        <div className={`${styles.container}`}>
            <Router>
                <Switch>
                    <ul className={`${styles.nav}`}>
                        <Route path="/login">
                        <li>Baligya</li>
                        </Route>
                        <li>Register</li>
                        <li>Login</li>
                    </ul>
                </Switch>
            </Router>
        </div>
    );
}

export default Header;
